-- Création de la table Prestation
CREATE TABLE Prestation (
    Id INT PRIMARY KEY,
    nom VARCHAR(255),
    caractéristiques TEXT,
    description TEXT,
    prix DECIMAL(10, 2),
    link TEXT
);

